import axios from "axios";
const API_URL = "http://localhost:5000/";

export const registerUser = async (name, email, password) => {
  const body = {
    name: name,
    email: email,
    password: password,
  };
  const res = await axios.post(API_URL + "api/user/register", body);
  console.log(await res);
};
